                    .then(data => {
                        //console.log(data.dbArray);
                        data.dbArray.forEach(element => {
                            comments.push(element);
                        });

                    })
                    .catch(error => console.error(error));
            }()

       // console.log(comments)

        const listComments = comments.map((comment) => {
            console.log(comment)
